import React from "react";
import "../Styles/Navbar.css";
import logo from "../img/-.png";
const Navbar = () => {
  return (
    <nav>
      <ul className="nav-list">
        <li className="nav-item">
          <a href="">
            <img src={logo} alt="" />
          </a>
        </li>
        <li className="nav-item">
          <a href="">Inicio</a>
        </li>
        <li className="nav-item">
          <a href="">Sobre m√≠</a>
        </li>
        <li className="nav-item">
          <a href="">Proyectos</a>
        </li>
        <li className="nav-item">
          <a href="">Habilidades</a>
        </li>
        <li className="nav-item">
          <a href="">Contacto</a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
